import React from "react";

const CoinDetails = ({ currentCoin }) => {
  window.details = currentCoin;

  console.log(currentCoin);
  return <div>{currentCoin ? <div>coin</div> : <div>coin</div>}</div>;
};

export default CoinDetails;
